import React from "react";

interface SelectBox {
  buffer: string;
}

export default function SelectedCellBox({buffer}: SelectBox) {
  return (
    <div className="w-1/5 bg-zinc-300 border-2 border-zinc-800 h-12 text-zinc-900 text-center align-center">
      Selected Cell: {buffer}
    </div>
  );
}
